import React from 'react';
import './NavigationItems';
import NavigationChevrons from './NavigationChevrons';
import NavigationItems from './NavigationItems';
import { Container } from 'react-bootstrap';

function Navigation() {

    return (
        <Container>
            <NavigationItems />
            <NavigationChevrons />
        </Container>
      );
}

export default Navigation;
